import {useParams} from 'react-router-dom'; 
import {useState, useEffect} from 'react';

import './PropertyInfo.css'; 

export default function PropertyInfo () {
    const { id } = useParams(); 
    const [propertyData, setPropertyData] = useState(); 
    const [images, setImages] = useState([]); 

    useEffect(() => {
        const getProperty = async () => {
            try {
                const response = await fetch(
                    `http://127.0.0.1:8000/api/buy/?id=${id}`, 
                    {
                        method: "GET", 
                        headers: {
                            // "Authorization": `JWT ${jwt.access}` 
                        }
                    }
                )
                const data = await response.json(); 
                setImages(data[0].images[0].image);
                setPropertyData(data); 
                // use map to deconstruct 
                // setImages(data[0].images.map((images)=> images.image))
            } 
            catch (error) {
                console.log(error)
            }
        }

        getProperty(); 
    }, [])



    if (images) {
        console.log(images);
    }

    return (
        <div>
            <div className='three-column-container'>
                <div className='images'>
                    <img 
                        className='image-lead' 
                        src={images}
                    />
                </div>
                <div className='buy-sell-tab'>
                    Buy/Sell 
                </div>
            </div>
            <div className='three-column-container'> 
                <div className='price-chart'>
                    Price history 
                </div>
                <div className='bid-ask-chart'>
                    Bid/ask chart
                </div>
            </div>

        </div>

    )
}
